import React , { useState, useEffect } from "react";

const axios  = require("axios")

function App() {

  const [nom,setNom] = useEffect("")
  const [dinero,setDinero] = useEffect("")

  const handlerA = (event) => {
    axios.get("/consulta",{
      params:{
        no:nom
      }
    }).then((response) => {
      setDinero(response.data)
    })

  }
  return (
    <div className="App">
     <form onSubmit={handlerA}>
      <input
      value={nom}
      onChange={(e) => setNom(e.target.value)}
      />
      <input type="submit"/>
     </form>
     <p>{dinero.dinero}</p>
    </div>
  );
}

export default App;
